// Configuracion del canvas
const canvas = document.querySelector('canvas');
const c = canvas.getContext('2d')
canvas.width = innerWidth;
canvas.height = innerHeight;

// Variables
const pi =  Math.PI;
let particles = [];
const mouse = {
    x:null,
    y:null,
    radius: 100
}
const returnSpeed = 4;
const densityFraction = 10;
const particleSize = 2;
window.addEventListener('mousemove', (e)=>{
    mouse.x = e.x;
    mouse.y = e.y;
})

function drawImage(){
    let imgHeight = png.height;
    let imgWidth = png.width;
    let data = c.getImageData(0,0,imgWidth,imgHeight);
    c.clearRect(0,0,canvas.width,canvas.height);

    window.addEventListener('resize', ()=>{
        canvas.width = innerWidth;
        canvas.height = innerHeight;
        init();       
    });


    class Particle{
        constructor(x,y,color){
            this.x = x +canvas.width/2 - png.width*2;
            this.y = y +canvas.height/2 - png.height*2;
            this.color = color,
            this.size = particleSize,
            this.initX = x+canvas.width/2 - png.width*2;
            this.initY = y+canvas.height/2 -png.height*2;
            this.density = Math.random()*densityFraction +2;
        }
        draw(){
            c.beginPath();
            c.arc(this.x,this.y,this.size,0,pi);
            c.closePath()
            c.fill();
        }
        update(){
            c.fillStyle = this.color;

            //colisiones
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx*dx + dy*dy);
            let forceDirectionX = 4*dx/distance;
            let forceDirectionY = 4*dy/distance;

            // distancia donde la fuerza sobre la particula ser√° cero
            const maxDistance = 100;
            let force = (maxDistance - distance)/maxDistance;
            if(force<0)force = 0;

            let directionX = (forceDirectionX*force*this.density);
            let directionY = (forceDirectionY*force*this.density);

            if(distance < mouse.radius +this.size){
                this.x -=directionX;
                this.y -=directionY;
            }else{
                // Con esto me aseguro que la particula vuelva a su posicion inicial
                if(this.x !== this.initX){
                    let dx = this.x -this.initX;
                    this.x -= dx/returnSpeed;
                }
                if(this.y !== this.initY){
                    let dy = this.y - this.initY;
                    this.y -=dy/returnSpeed;
                }
            }
            this.draw();
        }
    }

    function init(){
        particles = [];

        for(let y1 = 0,y2=data.height;y1<y2;y1++){
            for(let x1 = 0, x2 = data.width; x1<x2;x1++){
                if(data.data[(y1*4*data.width) + (x1 * 4) +3]>128){
                    let positionX = x1;
                    let positionY = y1;
                    let color = `rgb(${data.data[(y1*4*data.width)+(x1*4)]},
                                    ${data.data[(y1*4*data.width)+(x1*4)+1]},
                                    ${data.data[(y1*4*data.width)+(x1*4)+2]})`;
                    particles.push(new Particle(positionX*4,positionY*4,color))
                }
            }
        }
    }

    function animate(){
        requestAnimationFrame(animate);
        c.fillStyle = 'rgb(0,0,0,.8)';
        c.fillRect(0,0,innerWidth,innerHeight);

        particles.forEach(particle =>{
            particle.update();
        })
    }
    init();
    animate();
}

const png = new Image();
png.src='data:image/png;base64,'

addEventListener('load',(e)=>{
    c.drawImage(png,0,0);
    drawImage();
});